import React from "react";
import { Card, ListGroup } from "react-bootstrap";

const UserList = (props) => {
  const { user } = props;
  console.log("user is ", user);
  return (
    <div>
      {user ? (
        <Card>
          <ListGroup>
            {user.map((item, index) => {
              return <ListGroup.item key={index}>{item}</ListGroup.item>;
            })}
          </ListGroup>
        </Card>
      ) : null}
    </div>
  );
};

export default UserList;
